// src/components/MenuList.jsx
import React from "react";

const dietaryIcons = {
  vegan: "üå±",
  vegetarian: "ü•ó",
  glutenfree: "üö´üåæ",
};

const allergenIcons = {
  Celery: "ü•¨",
  Gluten: "üåæ",
  Crustaceans: "ü¶ê",
  Eggs: "ü•ö",
  Fish: "üêü",
  Lupin: "üå∏",
  Milk: "ü•õ",
  Molluscs: "üêö",
  Mustard: "üåø",
  Nuts: "üå∞",
  Peanuts: "ü•ú",
  Sesame: "‚ö™",
  Soy: "üå±",
  Sulphites: "üí®",
};

function dishMatchesSearch(dish, search) {
  if (!search) return true;
  const str = `${dish.Name} ${dish.Ingredients} ${dish.Notes}`.toLowerCase();
  return str.includes(search.toLowerCase());
}

function dishIsSafe(dish, filters, safeOnly) {
  if (!safeOnly) return true;

  const allergens = dish.Allergens?.split(",").map(a => a.trim().toLowerCase()) || [];
  for (const allergen of Object.keys(filters)) {
    if (filters[allergen] && allergens.includes(allergen.toLowerCase())) {
      return false;
    }
  }

  return true;
}

function dishMatchesDiet(dish, filters) {
  const tags = (dish["Dietary Tags"] || "").toLowerCase();
  return ["vegan", "vegetarian", "glutenfree"].every((tag) =>
    filters[tag] ? tags.includes(tag) : true
  );
}

export default function MenuList({ items, filters, search, safeOnly }) {
  const grouped = {};

  items.forEach((dish) => {
    const cat = dish.Category || "Other";
    if (!grouped[cat]) grouped[cat] = [];

    const show =
      dishMatchesSearch(dish, search) &&
      dishMatchesDiet(dish, filters) &&
      dishIsSafe(dish, filters, safeOnly);

    if (show) grouped[cat].push(dish);
  });

  return (
    <div className="px-4 pb-32">
      {Object.entries(grouped).map(([category, dishes]) => (
        <div key={category} className="mb-8">
          <h2 className="text-xl font-bold text-teal-800 mb-3">{category}</h2>
          {dishes.length === 0 ? (
            <p className="text-sm text-gray-500 italic">No dishes match your filters.</p>
          ) : (
            <div className="space-y-4">
              {dishes.map((dish) => (
                <div
                  key={dish.Name}
                  className="bg-white p-4 rounded-xl shadow border"
                >
                  <div className="flex justify-between items-center">
                    <h3 className="text-lg font-semibold text-gray-800">{dish.Name}</h3>
                    <span className="text-sm font-medium text-gray-700">‚Ç¨{dish.Price}</span>
                  </div>
                  <p className="text-sm text-gray-600">{dish.Ingredients}</p>

                  {/* Dietary Tags */}
                  {dish["Dietary Tags"] && (
                    <div className="text-sm mt-2 text-green-700">
                      <span className="font-medium">üå± Dietary: </span>
                      {dish["Dietary Tags"]
                        .split(",")
                        .map((tag) => tag.trim().toLowerCase())
                        .map((tag) => (
                          <span key={tag} className="inline-block mr-2">
                            {dietaryIcons[tag] || "‚úÖ"} {tag}
                          </span>
                        ))}
                    </div>
                  )}

                  {/* Allergen Tags */}
                  {dish.Allergens && dish.Allergens.toLowerCase() !== "none" && (
                    <div className="text-sm mt-1 text-red-700">
                      <span className="font-medium">‚ö†Ô∏è Allergens: </span>
                      {dish.Allergens
                        .split(",")
                        .map((a) => a.trim())
                        .map((a) => (
                          <span key={a} className="inline-block mr-2">
                            {allergenIcons[a] || "‚ùó"} {a}
                          </span>
                        ))}
                    </div>
                  )}

                  {/* Spicy Level */}
                  {dish["Spicy Level"] && dish["Spicy Level"] !== "None" && (
                    <div className="text-sm mt-1">üå∂Ô∏è {dish["Spicy Level"]}</div>
                  )}

                  {/* Notes */}
                  {dish.Notes && (
                    <div className="text-xs text-gray-500 italic mt-1">{dish.Notes}</div>
                  )}
                </div>
              ))}
            </div>
          )}
        </div>
      ))}
    </div>
  );
}
